import { Link } from "react-router-dom";

const Navbar = () => (
  <nav>
        <Link to="/">Home</Link>
        <Link to="/rooms">Rooms</Link>
        <Link to="/mybookings">My Bookings</Link>
    <Link to="/login">Login</Link> {/* Login link */}
    </nav>
  );

export default Navbar;
